    "      size = 3\n",
    "  ) +\n",
    "  geom_line(\n",
    "      aes(y = ride_length_member,\n",
    "          group = 1, \n",
    "          color = \"Member\"),\n",
    "      linetype = 1) +\n",
    "  # Points and line for ride_length_casual\n",
