    "mutate( percent = round((ride_count / sum(ride_count)) * 100, 1))\n",
    "\n",
    "# total bike types and their count - member riders.\n",
    "bike_data_count_member <- data |>\n",
    "filter(member_casual == \"member\") |>\n",
    "group_by(rideable_type) |>\n",
    "summarize(ride_count = n()) |>\n",
    "mutate(percent = round((ride_count / sum(ride_count)) * 100, 1))\n",
    "\n",
    "bike_data_count_casual\n",
    "bike_data_count_member\n",
