   "source": [
    "Above graph \"Count of Rides by Weekday\" shows that Members take significantly higher rides in weekdays (Mon - Fri) and than Weekends (Sat- Sun). Graph of Member riders grows from Monday to Wednesday, peaks at Wednesday and then declines and drops maximum at Sunday. Meanwhile, casual riders graph is significantly lower in weekdays (Mon - Fri) and the peaks at Saturday and drops on Sunday while still greater than Friday.\n",
    "Above graph \"Ride length summmed by Weekday\" shows that while length covered by member riders is almost consistent over whole week but casual riders sees a growth on Friday and spikes at Saturday by huge margin and the gets lower a but on Sunday. \n",
    "\n",
    "Insights from above 2 graphs infers that members use bikes more frequently than casual riders but are used for short distances while Casual riders use bikes during weekends majorly for long distances.\n"
   ]
