    "- Above pie chart shows that members travel most by classic bike with 54.7% of length covered by it and then closely folloed by electric bike with 44.2% share in length covered while the electric scooter lacks far behind with only 1.1% share in length covered.\n",
    "- Above pie chart show that of all the length covered by Casual riders 69% are by classic bike and electric bike stands with 29.1% share and electric scooter with 2%. Clearly depicting dominance of classic bikes for longer trips.\n",
    "- Above pie chart depicts that the usage of classic and electric bikes are almost same in members and casuals alike in percentage of count of rides of particular bike type. \n",
    "\n",
    "\n",
    "- We can infer that classic bike contributes most for length covered for both members and casual riders. While the elctric bike contributes almost closely in case of member riders but in casual riders the classic bike dominates. Meamwhile, electric scooter lacks far behind in contribution in length covered for both member and casual riders. \n",
    "- We can see that in terms of count of rides the electric bikes outperforms classic bikes and the share of eelctric scooter is increasing.\n",
    "- We can estimate that Riders prefer electric bike or electric scooter for shorter distances while classic ones for longer distances."
