   "source": [
    "- Above graph shows the trend of ride counts across the months. The ride count start increasing from january with lowest values and increases till September where it peaks and then drops significantly in October showing the possible decrease in year end months and increase in mid-year. While the members and casuals contribute to ride lengths increases similarly, members contribute significantly higher in year start (Jan - Mar) when the Casual ride count is significantly lower.\n",
    "- Above graph shows that while the members contribute more to ride length in year start (Jan - Mar), Casual riders starts closing the gap quickly, equaling in April and surpasses member riders in May month and start to increase significantly till july the stars to drop and drops significantly in October equaling with Member riders. \n",
    "\n",
    "- Possible reason for such pattern of in both the graphs may be due to impact of season. As the winter approches the use of bikes drops significantly and starts rising again when the winter ends."
