   "source": [
    "- \"Ride Count grouped by Hour of day\" graph shows that members use rides in early morning (5 am) and then starts increaing exponentially till 7 am and then drops till 10 AM after which it increases till 2 pm and remains same till 3 pm then increases exponentially peaking at 5 pm then decreases sharply . Casual riders count starts increasing after 5 am and increases till 5 pm then declines.\n",
    "- \"Ride Length grouped by Hour of day\" graph follows the trend of \"Ride Count grouped by Hour of day\" for members but not for casual riders. Casual riders ride for longer distances as the afternoon approaches and decline after that.\n",
    "\n",
    "- While the ride length and ride count of member riders can be classified by morning and afternoon rush hours (work time) while the casual riders may use the service more in afternoo rush hours."
   ]
